(18, 1026, '[{\"id\":106,\"sku\":\"The Relevant Church -The Power Of God\'s Choice\",\"name\":\"The Relevant Church -The Power Of God\'s Choice\",\"slug\":\"the-relevant-church-the-power-of-gods-choice\",\"description\":\"FAITH ADVENTURE 2020 (BUY BACK THE FUTURE) DAY 1 WITH REV. AROME TOKULA ON THE POWER OF GOD\\u2019S CHOICE Romans 9:16 (NKJV, TPT, MSG) God\'s choice doesn\'t depend on how much we want it or what we\'ve done to earn it. It depends on His mercy. Nothing provokes envy and jealousy like when someone gets more than you do, especially when you\'re doing all you need to do. A blessed man is someone to be envied Faith is a walk with God. You are more important than you think. God has you in His plans. You are God\'s choice! Predetermined means God has determined it before, and He\'s not going back on His choice Romans 9:7 (NKJV) In God\'s predetermined counsel, Isaac was the son of promise. Abraham, through his sweat, had Ishmael first. But God\'s choice was still Isaac, and that was who He carried out His plans through. Romans 9:9-12 (NKJV) It doesn\'t matter who is born first or who does what: what matter is what God says and who He chooses. Romans 8:28 (NKJV) The moment you heed the call of God, EVERYTHING will work for your good. Romans 8:29 (NKJV) It is not what is poured into the mold that determines its shape: the mold determines the shape.  Jesus is our mold. Once you believe and confess the lordship of Jesus, in the presence of God, you are exactly like Him. God\'s choice is Christ Jesus, and anyone who is in Christ Jesus is God\'s choice Declare: I am exactly like Jesus. From today, choose the words you speak about yourself. You are God\'s choice! That dream may look impossible, but you are God\'s choice. Begin to give God praise. You are God\'s choice! PROPHECIES \\ud83d\\udccdThere is something about your life that is bigger than you. People will wait for you to come before anything will be done. \\ud83d\\udccdCities are rising from you.  \\ud83d\\udccdWe are doing what governments cannot do. \\ud83d\\udccdThere are people who have been there before you, but they will stand and wait like they did for David, and nothing will be done until you get there, because you are God\'s choice. \\ud83d\\udccdI see kings rising up, I see governors, I see presidents, I see hospitals.  \\ud83d\\udccdTake your eyes off your struggles and fix them on God. #PastorAromeTokula #ThePowerofGodsChoice #FaithAdventure #DayOne #ChristFamilyMinistry\",\"unit_price\":100,\"discount_price\":0,\"is_taxable\":false,\"is_fulfilled\":false,\"is_available\":false,\"is_discountable\":false,\"is_active\":true,\"is_digital\":true,\"is_audio\":true,\"preacher_id\":1,\"date_preached\":\"2020-09-13T00:00:00.000000Z\",\"size\":\"1280147\",\"format\":\"image\\/png\",\"file_size\":\"42.44\",\"large_image_path\":\"https:\\/\\/shop-resource-server.christfamilyministries.org\\/public\\/products-images\\/1600868903.PNG\",\"thumbnail_image_path\":\"https:\\/\\/shop-resource-server.christfamilyministries.org\\/public\\/products-images\\/thumbnail\\/1600868903.PNG\",\"no_of_downloads\":5,\"pivot\":{\"bundle_id\":18,\"product_id\":106},\"preacher\":{\"id\":1,\"name\":\"Pastor Arome Tokula\",\"slug\":\"rev-arome-e-tokula\",\"deleted_at\":null,\"created_at\":\"2019-09-14T18:56:58.000000Z\",\"updated_at\":\"2019-09-14T18:56:58.000000Z\"}},{\"id\":107,\"sku\":\"The Relevant Church -The Power Of God\'s Choice\",\"name\":\"The Relevant Church -The Power Of God\'s Choice - pt1\",\"slug\":\"the-relevant-church-the-power-of-gods-choice-pt1\",\"description\":\"FAITH ADVENTURE 2020 (BUY BACK THE FUTURE) DAY 1 WITH REV. AROME TOKULA ON THE POWER OF GOD\\u2019S CHOICE Romans 9:16 (NKJV, TPT, MSG) God\'s choice doesn\'t depend on how much we want it or what we\'ve done to earn it. It depends on His mercy. Nothing provokes envy and jealousy like when someone gets more than you do, especially when you\'re doing all you need to do. A blessed man is someone to be envied